    <h3>About</h3>
    <h3>Portfolio</h3>
  </nav>
);
const Mypicture = ({
  data: {
    author: { firstName, lastName },
    introduction,
    skills,
    myskills
  }
}) => (
  <div>
    <img className="mypicture" src={mypicture} alt="Mypicture" />;
    <h2 className="myname">{author}</h2>
    <h5 className="myintroduction">{introduction}</h5>
