    },
    introduction: "超新手工程師 ",
    skills: "SKILLS :",
    myskills: "HTML,CSS,JavaScript,React "
  };
  return (
    <div className="App">
      <Nav />
      <Mypicture />
    </div>
  );
};

export default App;
